import React from 'react';
import './App.css';
import LoginContainer from './component/loginComponent/LoginContainer';

function App() {
  return (
    <div className="App">
       <div className="user-login"><button className="login">Login</button><button className="Signup">Signup</button></div>
	   <LoginContainer/>
    </div>
  );
}

export default App;
